import './style.css'
import cosmoNaft from '../../images/cosmonavt-poslugi2.png';

function DetailSection(){

    return(

        <section className='detail-section'>

            <div className='detail-conteiner'>

                <div className='detail-image'>
                    <img src={cosmoNaft} />
                </div>
                <div className='detail-description'>

                    <div className='detail-items'>
                        <h1>lore-sm</h1>
                    </div>

                    <div className='detail-items-description'>
                    <h2>Родительский элемент:
Если родительский элемент .detail-section (или его родитель) не занимает всю ширину экрана, то и .detail-section не сможет растянуться. Убедитесь, что все его родительские элементы имеют ширину 100%.</h2>
                    </div>


                </div>


             </div>


        </section>

    );
}
export default DetailSection;
